  summary: "\nDynamic provider that dispatches Quote Connector lists, based on QuoteAlternativeId or SaleId and &quot;Erp&quot;+&lt;list name>. \nConsider using &quot;QM_&quot;+&lt;sale_id>+&lt;list name> instead if you can.\n"
  remarks: "\nSee the remarks on <xref href=\"SuperOffice.CRM.Lists.QuoteListsByNameProvider\" data-throw-if-not-resolved=\"false\"></xref> for an overview of Quote List dispatching, which is fairly complex.\n"
  syntax:
    content: >-
      [DynamicMDOProviderPlugin("QuoteListsById", 1073741823)]

      [MDOAdditionalInfoSeparator("&")]

      [MDOAdditionalInfo("QuoteAlternativeId", "Quote alternative implies sale id, which tells us which quote connection to get", 1234)]

      [MDOAdditionalInfo("SaleId", "Sale to get quotes from which tells us which quote connection to get", 1234)]

      public sealed class QuoteListsByIdProvider : IDynamicMDOProvider, ISoListProvider, ISoList, IPlugin
    content.vb: >-
      <DynamicMDOProviderPlugin("QuoteListsById", 1073741823)>

      <MDOAdditionalInfoSeparator("&")>

